exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),url=`http://www.dswx.org/html/${bid.idPrefix()}/${bid}/index.html`;return parseCatalog(url,{cleaner:html=>cleanCatalogWrapper(html,/table [^>]*class="acss"[^>]*>/,"</table>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};